import React, {useState} from "react";
import {Link} from "react-router-dom";
import '../../../App.css'

// src/pages/index.js를 통해서 한번에 import 할 수 있도록 함

function MainTab() {
    return (
        <div>
            <div align='right'>

                <ul className="tabMenu">
                    <Link to="/main/art">
                        <li className="submenu">Art</li>
                    </Link>

                    <Link to="/main/my">
                        <li className="submenu">My</li>
                    </Link>

                    <Link to="/main/create">
                        <li className="submenu">Create</li>
                    </Link>

                    <Link to="/main/support">
                        <li className="submenu">Support</li>
                    </Link>
                </ul>

            </div>
            <div className="contents">
            </div>
        </div>
    );
}

export default MainTab;
